        {id:1,name:'Subhas'},
        {id:2,name:'Arko'},
        {id:3,name:'Arup'}
    ]
    return (
        <View>
            <FlatList
             data={friends}
             renderItem={(element)=>{
                 console.log(element)
             }}
            
            />
        </View>
    )
}

export default ListScreen

const styles = StyleSheet.create({})
